import React from "react";
import './style.css';

const Login = () => {
  return (
    <div className="login">
      <form
        className="login__form"
      >
        <label>Email</label>
        <input
          type="text"
          placeholder=""
        />

        <label>Senha:</label>
        <input
          type="password"
          placeholder=""
        />
        <input type="submit" value="Login"/>
      </form>
    </div>
  );
};

export default Login;
